    return (
      <ArtCard
        key={artwork.id}
        artwork={artwork}
        currentUser={currentUser}
        onAcquireArtwork={onAcquireArtwork}
      />
    );
  });

  return (
    <div style={{ margin: "0px 120px 0px 120px" }} className="art-container">
      {uArtwork}
    </div>
  );
}

export default ArtPage;
